import { Link } from "react-router-dom";
import {
  HeaderTransations,
  BoxTitle,
  BtnAvatar,
  MyIcash,
  Status,
  InfoTransations,
} from "./styles";
import arrowLeft from "../../assets/arrowLeft.svg";
const Transations = () => {
  return (
    <>
      <HeaderTransations>
        <BoxTitle>
          <Link to="/user-profile">
            <img src={arrowLeft} alt="voltar" />
          </Link>
          <span>Valor disponível em carteira</span>
          <BtnAvatar>R$ 105,00</BtnAvatar>
        </BoxTitle>
        <MyIcash>
          <span>Meu iCash</span>
        </MyIcash>
        <Status>
          <div className="approved">Aprovado</div>
          <div className="disapproved">Reprovado</div>
        </Status>
        <InfoTransations>
          <div className="month">Mês</div>
          <div>Descrição</div>
          <div>Cashback</div>
        </InfoTransations>
      </HeaderTransations>
    </>
  );
};

export default Transations;
